%[text] # **Waterfall Chart Examples**
%[text] **Overview**
%[text] The `WaterfallChart` visualizes the cumulative evolution of an initial value using floating bars to represent each change in the data. The final bar on the right-hand side of the chart represents the sum of the data values. At any given point on the $x$-axis, the chart shows the cumulative sum of the data values up to and including the current point.
%[text] The chart data comprises a numeric, real-valued vector `Data`.
%[text] ![](text:image:613d)
%[text] **Documentation**
%[text] - [`patch`](<matlab: doc("patch")>): create patches of colored polygons
%[text] - [`bar`](<matlab: doc("bar")>): bar graph
%[text] - [`line`](<matlab: doc("line")>): create primitive line
%[text] - [`text`](<matlab: doc("text")>): add text descriptions to data points \
%[text:tableOfContents]{"heading":"**Table of Contents**"}
%%
%[text] ## Create sample chart data.
rng( "default" )
data = randi( [-6, 6], 10, 1 );
%%
%[text] ## Create a figure for the chart.
f = exampleFigure( "Name", "WaterfallChart Example" ); %[output:07676b60]
%%
%[text] ## Create the chart.
WC = WaterfallChart( "Parent", f, "Data", data ); %[output:07676b60]
%%
%[text] ## Annotate the chart.
xlabel( WC, "x-data" ) %[output:02c4e768]
ylabel( WC, "y-data" ) %[output:02c4e768]
title( WC, "Waterfall Chart" ) %[output:02c4e768]
grid( WC, "on" ) %[output:02c4e768]
%%
%[text] ## Customize the chart's appearance.
%[text] Define distinct colors to distinguish positive and negative values.
colors = repmat( [0, 1, 0], numel( data ), 1 );
negativeIdx = data < 0;
colors(negativeIdx, :) = repmat( [1, 0, 0], sum( negativeIdx ), 1 );
%[text] Set the colors.
WC.BarFaceColor = colors; %[output:4d204a8b]
%[text] Customize the bar labels.
WC.BarLabelFormat = "$%.2f"; %[output:4d204a8b]
%[text] Adjust the bar appearance.
set( WC, "BarFaceAlpha", 0.75, "LineWidth", 2, "TotalBarFaceAlpha", 0.75 ) %[output:4d204a8b]
%%
%[text] ## Modify the chart's data.
%[text] Generate new data and update the bar colors.
newData = randi( [-6, 6], 15, 1 );
newColors = repmat( [0, 1, 0], numel( newData ), 1 );
negativeIdx = newData < 0;
newColors(negativeIdx, :) = repmat( [1, 0, 0], sum( negativeIdx ), 1 );

set( WC, "Data", newData, "BarFaceColor", newColors ) %[output:51ebb5b7]
%%
%[text] ## Select a subset of the chart data.
WC.Data = WC.Data(1:5); %[output:8d95e653]
%%
%[text] ## Customize the base and target lines.
set( WC, "BaseLineWidth", 2, ... %[output:group:5ca86396] %[output:34e6ecad]
    "TargetLineVisible", "on", ... %[output:34e6ecad]
    "TargetLineValue", 5, ... %[output:34e6ecad]
    "TargetLineColor", "y", ... %[output:34e6ecad]
    "TargetLineLabel", "Target", ... %[output:34e6ecad]
    "TargetLineWidth", 2 ) %[output:group:5ca86396] %[output:34e6ecad]

